import base64, zlib, cPickle as pickle

_d = {}

def _add(encd, allow_overwrite=True):
    global _d
    d = pickle.loads(zlib.decompress(base64.b64decode(encd)))
    if not allow_overwrite:
        for k in d:
            if _d.has_key(d):
                raise ValueError('already have key %r' % k)
    _d.update(d)

def get(name, ds):
    return _d.get((name, ds), None)

_add('')


